import { Link } from "react-router-dom";

const AnimeList = ({anime}) => {
    return ( 
        anime.map((ani) => (
            <div>
                
                    <tr>
                    <Link to={`/anime/${ani.id}`}>
                        <td>{ani.id}</td>
                        <td><img src={ani.pic} /></td>
                        <td>{ani.title}</td>
                        <td>{ani.score}</td>
                    </Link>
                    </tr>
                
            </div>
        ))

     );
}
 
export default AnimeList;
